import React from "react";

import Icon from "./icon"
import Logo from "./logo"

export function Sidebar(props) {
  return (<div className="sidebar">
    <Logo logo={props.logo} />
    <Logo homeIcon={props.homeIcon} />
    <Icon></Icon>
  </div>)
}
